<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Movement Patterns - Scrollytelling Timeline</title>
    <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css" />
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Arial', sans-serif;
            background-color: #000;
            color: #fff;
            overflow-x: hidden;
        }

        .container {
            position: relative;
            height: 100vh;
        }

        #map {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100vh;
            z-index: 1;
        }
        
        /* Remove dark styling to show full-color satellite imagery */
        .leaflet-tile {
            filter: none !important;
        }

        .content {
            position: relative;
            z-index: 2;
            height: 3000vh; /* 30x viewport height for very smooth scrolling */
        }

        .scroll-section {
            height: 100vh;
            display: flex;
            align-items: center;
            justify-content: flex-start;
            padding: 0 5%;
            position: relative;
        }

        .text-content {
            background: rgba(0, 0, 0, 0.8);
            padding: 2rem;
            border-radius: 8px;
            max-width: 400px;
            backdrop-filter: blur(10px);
            border: 1px solid rgba(255, 255, 255, 0.1);
            transition: opacity 0.3s ease, transform 0.3s ease;
        }

        /* Fade out text content as it approaches center on mobile */
        @media (max-width: 768px) {
            .scroll-section {
                justify-content: center;
                padding: 0 2%;
            }
            
            .text-content {
                max-width: 85%;
                padding: 1.5rem;
                opacity: 0.95;
            }
            
            /* Create fade effect based on scroll position */
            .scroll-section:nth-child(3) .text-content,
            .scroll-section:nth-child(4) .text-content,
            .scroll-section:nth-child(5) .text-content {
                opacity: 0.7;
                transform: scale(0.95);
            }
            
            .scroll-section:nth-child(4) .text-content {
                opacity: 0.5;
                transform: scale(0.9);
            }
        }

        .text-content h1 {
            font-size: 2.5rem;
            margin-bottom: 1rem;
            font-weight: 300;
            letter-spacing: -0.02em;
        }

        .text-content h2 {
            font-size: 1.8rem;
            margin-bottom: 1rem;
            font-weight: 300;
            color: #ccc;
        }

        .text-content p {
            font-size: 1.1rem;
            line-height: 1.6;
            color: #aaa;
            margin-bottom: 1rem;
        }

        .time-display {
            position: fixed;
            top: 2rem;
            right: 2rem;
            z-index: 3;
            background: rgba(0, 0, 0, 0.8);
            padding: 1rem 1.5rem;
            border-radius: 8px;
            border: 1px solid rgba(255, 255, 255, 0.1);
            backdrop-filter: blur(10px);
        }

        .time-display .time {
            font-size: 1.2rem;
            font-weight: 300;
            margin-bottom: 0.5rem;
        }

        .time-display .date {
            font-size: 0.9rem;
            color: #aaa;
        }

        .progress-bar {
            position: fixed;
            bottom: 2rem;
            left: 50%;
            transform: translateX(-50%);
            z-index: 3;
            width: 300px;
            height: 4px;
            background: rgba(255, 255, 255, 0.2);
            border-radius: 2px;
            overflow: hidden;
        }

        .progress-fill {
            height: 100%;
            background: #fff;
            width: 0%;
            transition: width 0.1s ease;
        }


        /* Override map filter for markers to show true colors */
        .leaflet-interactive {
            filter: none !important;
        }

        @media (max-width: 768px) {
            .text-content {
                max-width: 90%;
                padding: 1.5rem;
            }
            
            .text-content h1 {
                font-size: 2rem;
            }
            
            .time-display {
                top: 1rem;
                right: 1rem;
                padding: 0.8rem 1rem;
            }
            
            .progress-bar {
                width: 200px;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <div id="map"></div>
        
        <div class="time-display">
            <div class="time" id="current-time">12:06:00</div>
            <div class="date">February 13, 2017</div>
        </div>
        
        <div class="progress-bar">
            <div class="progress-fill" id="progress-fill"></div>
        </div>
        
        
        <div class="content">
            <div class="scroll-section" data-target-time="12:00:00">
                <div class="text-content">
                    <h1> &#8595; Scroll down to move the timeline forward</h1>
                </div>
            </div>
            
            <div class="scroll-section" data-target-time="12:10:30">
               <div class="text-content">
                     <p><strong>12:10pm: </strong>Betsy Blair begins her walk.</p>
                     <p>
                        <img  src="https://preview.redd.it/betsy-blairs-fitbit-data-v0-ktvtri8rpg8f1.png?width=940&auto=webp&s=f8d18fd5ba68fcb4e8f692589f3db118306acd3e" 
                        alt="Description of the image for accessibility" 
                        style="width: 100%; height: auto; display: block;" />
                     </p>
                  </div>
            </div>

            <div class="scroll-section" data-target-time="14:30:00">
                <div class="text-content">
                    <p><strong>2:30pm: </strong>End of timeline.</p>
                </div>
            </div>
    </div>
    </div>

    <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
    <script>
        // ============================================================================
        // APPLICATION CORE CODE - DO NOT MODIFY THIS SECTION
        // ============================================================================
        
        // Global variables
        let map;
        let markers = {};
        let allData = {};
        let timelineData = [];
        let startTime, endTime;
        let routeLines = {};

        // Initialize the map
        function initMap() {
            map = L.map('map', {
                zoomControl: false,
                attributionControl: false,
                dragging: false,
                touchZoom: false,
                doubleClickZoom: false,
                scrollWheelZoom: false,
                boxZoom: false,
                keyboard: false
            });

            // Use Esri World Imagery for high-resolution satellite imagery
            L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}', {
                attribution: '',
                maxZoom: 15
            }).addTo(map);
        }

        // Load and process embedded data
        function loadData() {
            console.log('Loading embedded data...');

            Object.keys(MARKER_DATA).forEach(name => {
                const entityData = MARKER_DATA[name];
                
                allData[name] = entityData.map(point => ({
                    time: new Date(point.time),
                    lat: point.lat,
                    lng: point.lng
                }));

                console.log(`${name} has ${allData[name].length} key points`);

                // Find first valid position for marker initialization
                let firstValidPoint = null;
                for (const point of allData[name]) {
                    if (point.lat !== null && point.lng !== null) {
                        firstValidPoint = point;
                        break;
                    }
                }
                
                // Use first valid point or default coordinates if all are null
                const initPoint = firstValidPoint || { lat: 40.594, lng: -86.656 };
                
                // Create marker for this entity
                const marker = L.circleMarker([initPoint.lat, initPoint.lng], {
                    radius: 15,
                    fillColor: MARKER_COLORS[name],
                    color: '#ffffff',
                    weight: 3,
                    opacity: firstValidPoint ? 1 : 0,
                    fillOpacity: firstValidPoint ? 1 : 0,
                    className: `marker-${name.toLowerCase()}`
                }).addTo(map);

                // Create text label for the marker
                const label = L.divIcon({
                    className: 'marker-label',
                    html: `<div style="
                        color: #000;
                        font-weight: bold;
                        font-size: 12px;
                        text-align: center;
                        line-height: 30px;
                        text-shadow: 1px 1px 2px rgba(255,255,255,0.9);
                        pointer-events: none;
                        font-family: Arial, sans-serif;
                        width: 30px;
                        height: 30px;
                        display: flex;
                        align-items: center;
                        justify-content: center;
                    ">${name}</div>`,
                    iconSize: [30, 30],
                    iconAnchor: [15, 15]
                });

                const labelMarker = L.marker([initPoint.lat, initPoint.lng], {
                    icon: label,
                    interactive: false,
                    opacity: firstValidPoint ? 1 : 0
                }).addTo(map);
                
                markers[name] = { circle: marker, label: labelMarker };
                console.log(`Created marker for ${name} at [${initPoint.lat}, ${initPoint.lng}]${firstValidPoint ? '' : ' (hidden - starts with null coordinates)'}`);
            });

            // Create route lines
            createRouteLines();

            processTimeline();
            setMapBounds();
            updateMarkersForTime(0);
        }

        // Create route lines from route definitions
        function createRouteLines(routesToCreate = null) {
            // If no specific routes provided, create all routes from ROUTE_DEFINITIONS
            const routesToProcess = routesToCreate || Object.keys(ROUTE_DEFINITIONS);
            
            routesToProcess.forEach(routeId => {
                const routeDef = ROUTE_DEFINITIONS[routeId];
                
                if (!routeDef) {
                    console.warn(`Route definition not found for: ${routeId}`);
                    return;
                }
                
                // Validate coordinates
                if (!routeDef.coordinates || routeDef.coordinates.length < 2) {
                    console.warn(`Invalid coordinates for route: ${routeId}`);
                    return;
                }
                
                // Create the route line with specified styling
                const routeLine = L.polyline(routeDef.coordinates, {
                    color: routeDef.color || '#ff8800',
                    weight: routeDef.weight || 3,
                    opacity: routeDef.opacity || 0.6,
                    smoothFactor: routeDef.smoothFactor || 1
                }).addTo(map);
                
                routeLines[routeId] = routeLine;
                console.log(`Created route line "${routeDef.name}" with ${routeDef.coordinates.length} points`);
            });
        }

        // Process timeline data
        function processTimeline() {
            const allTimes = new Set();
            
            // Collect all unique timestamps (including null coordinate times)
            Object.values(allData).forEach(entityData => {
                entityData.forEach(point => {
                    allTimes.add(point.time.getTime());
                });
            });

            // Sort times and create timeline
            const sortedTimes = Array.from(allTimes).sort((a, b) => a - b);
            startTime = new Date(sortedTimes[0]);
            endTime = new Date(sortedTimes[sortedTimes.length - 1]);

            console.log('Processing timeline from', startTime, 'to', endTime);

            // Create interpolated timeline with regular intervals
            const totalDuration = endTime - startTime;
            const steps = 1000; // Number of interpolation steps
            
            for (let i = 0; i <= steps; i++) {
                const progress = i / steps;
                const currentTime = new Date(startTime.getTime() + (totalDuration * progress));
                
                const timelinePoint = { time: currentTime, positions: {} };
                
                // Interpolate position for each entity at this time
                Object.keys(allData).forEach(entityName => {
                    try {
                        const entityData = allData[entityName];
                        const position = interpolatePosition(entityData, currentTime);
                        timelinePoint.positions[entityName] = position;
                    } catch (error) {
                        console.error(`Error interpolating position for ${entityName}:`, error);
                        timelinePoint.positions[entityName] = null;
                    }
                });
                
                timelineData.push(timelinePoint);
            }
            
            console.log('Timeline processed successfully with', timelineData.length, 'points');
        }

        // Interpolate position for an entity at a specific time
        function interpolatePosition(entityData, targetTime) {
            if (entityData.length === 0) return null;
            
            // Find the two points to interpolate between
            let beforePoint = entityData[0];
            let afterPoint = entityData[entityData.length - 1];
            
            for (let i = 0; i < entityData.length - 1; i++) {
                if (entityData[i].time <= targetTime && entityData[i + 1].time >= targetTime) {
                    beforePoint = entityData[i];
                    afterPoint = entityData[i + 1];
                    break;
                }
            }
            
            // If target time is before first point, return first point
            if (targetTime <= entityData[0].time) {
                return { lat: entityData[0].lat, lng: entityData[0].lng };
            }
            
            // If target time is after last point, return last point
            if (targetTime >= entityData[entityData.length - 1].time) {
                const last = entityData[entityData.length - 1];
                return { lat: last.lat, lng: last.lng };
            }
            
            // Check if either point has null coordinates (invisible marker)
            if (beforePoint.lat === null || beforePoint.lng === null) {
                return { lat: null, lng: null };
            }
            if (afterPoint.lat === null || afterPoint.lng === null) {
                return { lat: null, lng: null };
            }
            
            // Linear interpolation
            const timeDiff = afterPoint.time - beforePoint.time;
            const targetDiff = targetTime - beforePoint.time;
            const ratio = timeDiff > 0 ? targetDiff / timeDiff : 0;
            
            return {
                lat: beforePoint.lat + (afterPoint.lat - beforePoint.lat) * ratio,
                lng: beforePoint.lng + (afterPoint.lng - beforePoint.lng) * ratio
            };
        }

        // Set map bounds to show all data
        function setMapBounds() {
            const allPoints = [];
            Object.values(allData).forEach(entityData => {
                entityData.forEach(point => {
                    // Only include valid coordinates
                    if (point.lat !== null && point.lng !== null) {
                        allPoints.push([point.lat, point.lng]);
                    }
                });
            });
            
            if (allPoints.length > 0) {
                const group = new L.featureGroup(allPoints.map(point => L.marker(point)));
                map.fitBounds(group.getBounds().pad(0.1));
                
                // Ensure we're zoomed in to show ~2km area
                if (map.getZoom() > 15) {
                    map.setZoom(15);
                }
            }
        }

        // Update marker positions for a given progress (0-1)
        function updateMarkersForTime(progress) {
            if (timelineData.length === 0) {
                console.log('No timeline data available');
                return;
            }
            
            const index = Math.floor(progress * (timelineData.length - 1));
            const timelinePoint = timelineData[index];
            
            if (!timelinePoint) {
                console.log('No timeline point for index:', index);
                return;
            }
            
            // Update markers
            Object.keys(markers).forEach(entityName => {
                const position = timelinePoint.positions[entityName];
                if (markers[entityName]) {
                    if (!position || position.lat === null || position.lng === null) {
                        // Hide markers when coordinates are null or missing
                        markers[entityName].circle.setStyle({ opacity: 0, fillOpacity: 0 });
                        markers[entityName].label.setOpacity(0);
                    } else {
                        // Show and update markers when coordinates are valid
                        markers[entityName].circle.setStyle({ opacity: 1, fillOpacity: 1 });
                        markers[entityName].label.setOpacity(1);
                        markers[entityName].circle.setLatLng([position.lat, position.lng]);
                        markers[entityName].label.setLatLng([position.lat, position.lng]);
                    }
                }
            });
            
            // Update camera position based on timeline
            updateCameraForTime(timelinePoint.time);
            
            // Update time display
            if (timelinePoint.time && !isNaN(timelinePoint.time.getTime())) {
                const timeStr = timelinePoint.time.toLocaleTimeString('en-US', { 
                    hour12: false,
                    hour: '2-digit',
                    minute: '2-digit',
                    second: '2-digit',
                    timeZone: 'UTC'
                });
                document.getElementById('current-time').textContent = timeStr;
            } else {
                document.getElementById('current-time').textContent = '12:06:00';
            }
            
            // Update progress bar
            document.getElementById('progress-fill').style.width = (progress * 100) + '%';
        }

        // Update camera position and zoom based on timeline
        function updateCameraForTime(currentTime) {
            if (!currentTime || CAMERA_DEFINITIONS.length === 0) return;
            
            // Convert current time to comparable format
            const timeStr = currentTime.toLocaleTimeString('en-US', { 
                hour12: false,
                hour: '2-digit',
                minute: '2-digit',
                second: '2-digit',
                timeZone: 'UTC'
            });
            
            // Find the appropriate camera position for this time
            let targetCamera = CAMERA_DEFINITIONS[0]; // Default to first camera
            
            for (let i = 0; i < CAMERA_DEFINITIONS.length; i++) {
                const camera = CAMERA_DEFINITIONS[i];
                if (timeStr >= camera.time) {
                    targetCamera = camera;
                } else {
                    break;
                }
            }
            
            // Smoothly transition to the target camera position
            const currentCenter = map.getCenter();
            const currentZoom = map.getZoom();
            
            // Only update if there's a significant change to avoid constant updates
            const centerDistance = map.distance(currentCenter, targetCamera.center);
            const zoomDifference = Math.abs(currentZoom - targetCamera.zoom);
            
            if (centerDistance > 50 || zoomDifference > 0.5) {
                map.setView(targetCamera.center, targetCamera.zoom, {
                    animate: true,
                    duration: 1.0
                });
            }
        }

        // Handle scroll events
        function handleScroll() {
            const scrollTop = window.pageYOffset;
            const docHeight = document.documentElement.scrollHeight - window.innerHeight;
            const scrollProgress = Math.min(Math.max(scrollTop / docHeight, 0), 1);
            
            // Use time-based scroll positioning if sections have target times
            const timeBasedProgress = calculateTimeBasedProgress();
            const finalProgress = timeBasedProgress !== null ? timeBasedProgress : scrollProgress;
            
            updateMarkersForTime(finalProgress);
            updateTextContentVisibility();
        }

        // Calculate progress based on scroll section target times
        function calculateTimeBasedProgress() {
            if (!startTime || !endTime) {
                console.log('No start/end time available for time-based progress');
                return null;
            }
            
            const scrollSections = document.querySelectorAll('.scroll-section[data-target-time]');
            if (scrollSections.length === 0) {
                console.log('No sections with target times found');
                return null;
            }
            
            const viewportHeight = window.innerHeight;
            const scrollTop = window.pageYOffset;
            
            // Find which section is currently in view (center of viewport)
            let currentSection = null;
            let nextSection = null;
            let sectionProgress = 0;
            
            for (let i = 0; i < scrollSections.length; i++) {
                const section = scrollSections[i];
                const rect = section.getBoundingClientRect();
                const sectionTop = scrollTop + rect.top;
                const sectionBottom = sectionTop + rect.height;
                const viewportCenter = scrollTop + (viewportHeight / 2);
                
                if (viewportCenter >= sectionTop && viewportCenter <= sectionBottom) {
                    currentSection = section;
                    nextSection = scrollSections[i + 1] || null;
                    
                    // Calculate progress within this section (0-1)
                    sectionProgress = (viewportCenter - sectionTop) / rect.height;
                    break;
                }
            }
            
            if (!currentSection) {
                // Before first section or after last section
                if (scrollTop < scrollSections[0].offsetTop) {
                    currentSection = scrollSections[0];
                    sectionProgress = 0;
                } else {
                    currentSection = scrollSections[scrollSections.length - 1];
                    sectionProgress = 1;
                }
            }
            
            // Parse target times
            const currentTargetTime = parseTargetTime(currentSection.getAttribute('data-target-time'));
            const nextTargetTime = nextSection ? parseTargetTime(nextSection.getAttribute('data-target-time')) : null;
            
            if (!currentTargetTime) {
                console.log('Failed to parse current target time:', currentSection.getAttribute('data-target-time'));
                return null;
            }
            
            // Calculate timeline progress based on target times
            let targetTime;
            if (nextTargetTime && sectionProgress > 0) {
                // Interpolate between current and next target times
                const timeDiff = nextTargetTime.getTime() - currentTargetTime.getTime();
                targetTime = new Date(currentTargetTime.getTime() + (timeDiff * sectionProgress));
            } else {
                targetTime = currentTargetTime;
            }
            
            // Convert target time to timeline progress (0-1)
            const totalDuration = endTime.getTime() - startTime.getTime();
            const timeProgress = (targetTime.getTime() - startTime.getTime()) / totalDuration;
            
            // Add validation to prevent NaN
            if (isNaN(timeProgress)) {
                console.log('Time progress calculation resulted in NaN:', {
                    targetTime: targetTime.getTime(),
                    startTime: startTime.getTime(),
                    endTime: endTime.getTime(),
                    totalDuration
                });
                return null;
            }
            
            return Math.min(Math.max(timeProgress, 0), 1);
        }

        // Parse target time string to Date object
        function parseTargetTime(timeString) {
            if (!timeString) return null;
            
            try {
                // Handle different time formats
                let dateStr;
                if (timeString.includes(':')) {
                    // Format like "12:06:00" or "12:06"
                    const timeParts = timeString.split(':');
                    if (timeParts.length === 2) {
                        dateStr = `2017-02-13T${timeString}:00Z`;
                    } else {
                        dateStr = `2017-02-13T${timeString}Z`;
                    }
                } else {
                    dateStr = `2017-02-13T${timeString}:00:00Z`;
                }
                
                const parsedDate = new Date(dateStr);
                if (isNaN(parsedDate.getTime())) {
                    console.warn('Invalid date created from:', timeString, '->', dateStr);
                    return null;
                }
                
                return parsedDate;
            } catch (error) {
                console.warn('Invalid target time format:', timeString, error);
                return null;
            }
        }

        // Update text content visibility based on scroll position
        function updateTextContentVisibility() {
            const scrollSections = document.querySelectorAll('.scroll-section');
            const viewportHeight = window.innerHeight;
            const centerY = viewportHeight / 2;
            
            scrollSections.forEach((section, index) => {
                const rect = section.getBoundingClientRect();
                const sectionCenterY = rect.top + (rect.height / 2);
                const textContent = section.querySelector('.text-content');
                
                if (textContent) {
                    // Calculate distance from viewport center
                    const distanceFromCenter = Math.abs(sectionCenterY - centerY);
                    const maxDistance = viewportHeight / 2;
                    
                    // Calculate opacity based on distance from center
                    let opacity = 1;
                    let scale = 1;
                    
                    if (window.innerWidth <= 768) { // Mobile devices
                        // Start fading when approaching center (within 40% of viewport height)
                        const fadeZone = viewportHeight * 0.4;
                        
                        if (distanceFromCenter < fadeZone) {
                            const fadeProgress = 1 - (distanceFromCenter / fadeZone);
                            opacity = Math.max(0.1, 1 - (fadeProgress * 0.8));
                            scale = Math.max(0.8, 1 - (fadeProgress * 0.2));
                        }
                    }
                    
                    textContent.style.opacity = opacity;
                    textContent.style.transform = `scale(${scale})`;
                }
            });
        }

        // Initialize everything
        function init() {
            try {
                console.log('Starting initialization...');
                initMap();
                console.log('Map initialized');
                
                // Set a default view first
                map.setView([40.592, -86.647], 15);
                console.log('Map view set');
                
                loadData();
                console.log('Data loaded');
                
                // Add scroll listener
                window.addEventListener('scroll', handleScroll);
                console.log('Scroll listener added');
                
                // Initial update
                handleScroll();
                console.log('Initial scroll handled');
                
                console.log('Initialization complete');
                console.log('Timeline data points:', timelineData.length);
                console.log('Start time:', startTime);
                console.log('End time:', endTime);
            } catch (error) {
                console.error('Initialization error:', error);
                console.error('Error stack:', error.stack);
                
                // Still add scroll listener even if there's an error
                try {
                    window.addEventListener('scroll', handleScroll);
                    console.log('Scroll listener added in fallback');
                } catch (scrollError) {
                    console.error('Failed to add scroll listener:', scrollError);
                }
                
                // Fallback: ensure map is visible
                if (map) {
                    map.setView([40.592, -86.647], 15);
                }
                
                // Set fallback time
                document.getElementById('current-time').textContent = '12:06:00';
            }
        }

        // ============================================================================
        // DATA CONFIGURATION SECTION - EDIT THIS SECTION TO ADD/MODIFY DATA
        // ============================================================================
        
        // Marker colors for each entity
        const MARKER_COLORS = {
            'A_L': '#ecb5c0',
            'BB': '#8e13ec', 
            'BG': '#4444ff',
            'G4': '#39c63a',
            'RA': '#cccccc'
        };

        // Camera/view definitions for different timeline moments
        const CAMERA_DEFINITIONS = [
            {
                time: "12:00:00",
                center: [40.592, -86.647],
                zoom: 15,
                description: "Overview of all starting positions"
            },
            {
                time: "12:06:00",
                center: [40.592, -86.647],
                zoom: 15,
                description: "Overview of all starting positions"
            },
            {
                time: "14:20:00",
                center: [40.588, -86.641],
                zoom: 16,
                description: "Final positions view"
            }
        ];

        // Route line definitions (separate from movement data)
        const ROUTE_DEFINITIONS = {
me_dc: {
  name: 'me_dc',
